import React from "react";
import { motion } from "framer-motion/dist/framer-motion";
import "../pages/products.scss";

const Products = () => {
  return (
    <div className="product">
      <h2>Products</h2>
      <motion.div
        className="circles"
        animate={{
          scale: [1, 2, 2, 1, 1],
          rotate: [0, 0, 270, 270, 0],
          borderRadius: ["20%", "20%", "50%", "50%", "20%"],
        }}
      ></motion.div>
    </div>
  );
};

export default Products;
